    [],nt"revision_timestamp": "2015-07-12T02:56:28.568414",nt"name": "marsh-bird-monitoring-activities-in-vermont-in-1998",nt"isopen":
    false,nt"url": null,nt"notes": "Marsh bird studies performed in 1998 were
    primarily a continuation of the basic population monitoring started in previous
    years. A complete census of known black tern nesting areas in Vermont was performed
    in order to continue tracking the status of this species which is listed as threatened
    in Vermont. In addition, the effort to gather more information on the distribution
    and abundance of other nongame marsh birds such as bitterns and rails continued
    and was expanded. These activities together have two major objectives: to look at
    marsh bird population trends in Vermont, and to investigate the effect of marsh
    vegetation changes on their numbers.",nt"license_title": "License Not Specified",nt"extras":
